import './styles.css';
import Card from '../Card';

const List = ({listTransactions }) => {

  return (
    <div className='container'>
      <ul className='list__transactions'>

        {listTransactions.map((transaction, index) => <Card transaction={transaction} key={index}/>)}
      </ul>
    </div>
  )
}

export default List;
